import React, { Component, useState } from 'react';
import Base from './base';
import $ from 'jquery'

const Friends = () => {

  const [users, setusers] = useState({});

  $.ajax({
    url: "https://app165.acapp.acwing.com.cn/myspace/userlist/",
    type: "GET",
    success(resp) {
      users.value = resp
    }
  })
  
  return ( 
    <Base>
      {users.value.map(user => (
        <div>user.id</div>
      ))}
    </Base>
  );
}

export default Friends
